    value: 'There is an expenditure to the Florida Division of Elections on 5/13/10
      in the amount of $10 for the purchase of a voter file. This is a Type II FEA
      expense and is within the FEA reporting window. The Committee is now reporting
      on a monthly basis for the remainder of 2010. The expenditure is not reflected
      in detail on Schedule B, line 30b because it is below the reporting itemization
      threshold of $200. The refund reported on line 15 as an Offset to Operating
      Expenditure is from a 5/29/08 expenditure that was paid with 100% Federal dollars.
      The negative disbursements from various news services and one individual are
      not voided checks, they represent payment to the Committee to purchase copies.
      The original operating expenses of the Committee were all paid by the Committee
      as admin allocated activity and therefore, the purchase of these items is recorded
      as such. The expenditure to Desumo Strategies on 5/27/10 for printed material
      does not represent an FEA activity as the printed material is not a public communication
      and does not promote or oppose any candidates. No expenditure, other than a
      direct contribution or exempt activity so identified, was made on behalf of
      a specifically identified federal candidate. No expenditure not identified as
      such was for a public communication that referred to a clearly identified candidate
      for Federal office and that promoted, supported, attacked or opposed any such
      candidate for Federal office. All expenditures to individuals for rent represent
      rent income to those individuals and arent required to be itemized. All disbursements
      for salaries and benefits disclosed on Schedule H4 are for employees who did
      not spend more than 25% of their compensated time during the reporting period
      on Fed election activities or activities in connection with a Federal election.
      All transfers for allocated activity reported on Sch H3 occurred within the
      70-day permitted window of time. The Committee uses the Escrow option for receipt
      of corporate in-kind donations as provided for by the Commission in Advisory
      Opinion 1992-33. The method ensures that prohibited sources are not used to
      fund the federal share of allocable activity expenses. In June 2010, it was
      discovered that an administrative corporate in-kind was inadvertently left off
      of report. The appropriate 2008 reports have been amended to correctly report
      that in-kind. The Committee had sufficient funds in the escrow account at the
      time of the in-kind and has maintained a combined positive balance since that
      time.  In-kind details and the escrow account activity are summarized as follows:   Admin
      Acct: 4/1/10 Admin escrow balance $315.75 (Revised due to 2008 amended reports
      mentioned above).   4/4/10 Yuma Solutions in-kind of $4,000 as reflected on
      Sch H4 and transfer on Sch H3 using $840 of escrow balance.  5/3/10 transfer
      to Admin escrow account of $840.  5/4/10 Yuma Solutions in-kind of $4,000 as
      reflected on Sch H4 and transfer on Sch H3 using $840 of escrow balance.  5/28/10
      transfer to Admin escrow account of $600 from MD-10B escrow account as reflected
      on Sch H4.  5/31/10 Admin escrow balance of $75.75  3/31/10 MD-10B escrow account
